import string

def calculate_ioc(text):
    """Calculates the Index of Coincidence (IoC) for a given text."""
    N = len(text)
    if N < 2:
        return 0.0

    # English expected IoC is around 0.0667. Random text is around 0.0385.
    
    # 1. Get frequency counts for A-Z
    freqs = {}
    for char in string.ascii_uppercase:
        freqs[char] = text.count(char)

    # 2. Calculate the sum of f_i * (f_i - 1)
    sum_fi = sum(f * (f - 1) for f in freqs.values())

    # 3. Calculate IoC = (sum_fi) / (N * (N - 1))
    ioc = sum_fi / (N * (N - 1))
    return ioc

def find_key_length(ciphertext, max_key_len=15):
    """
    Finds the likely key length by testing key lengths from 1 up to max_key_len.
    The most likely length is the one that gives the highest average IoC 
    when the ciphertext is split into 'key_len' columns.
    """
    print("--- 1. ESTIMATING KEY LENGTH ---")
    
    best_ioc = 0.0
    best_len = 1
    
    # Check key lengths from 1 up to max_key_len
    for key_len in range(1, max_key_len + 1):
        ioc_values = []
        
        # Split the ciphertext into key_len sub-texts (columns)
        for i in range(key_len):
            sub_text = "".join(ciphertext[j] for j in range(i, len(ciphertext), key_len))
            ioc_values.append(calculate_ioc(sub_text))

        # Calculate the average IoC for this key length
        avg_ioc = sum(ioc_values) / len(ioc_values)

        if avg_ioc > best_ioc:
            best_ioc = avg_ioc
            best_len = key_len
        
        print(f"Key Length {key_len}: Average IoC = {avg_ioc:.4f}")

    print(f"\n✅ Guessed Key Length: **{best_len}** (with IoC: {best_ioc:.4f})\n")
    return best_len

def determine_vigenere_key(ciphertext, key_len):
    """
    Determines the key by performing frequency analysis on each sub-text (column).
    The shift that aligns the column's highest frequency with 'E' (most common English letter) 
    is the likely key character for that column.
    """
    print("--- 2. DETERMINING KEY CHARACTERS ---")
    
    key = ""
    ENGLISH_FREQ_ORDER = "ETAOINSHRDLCUMWFGYPBVKJXQZ" # Expected frequency order
    
    # Frequency of A-Z in standard English (for chi-squared test, optional, but useful)
    # Using the standard 'E' method is simpler and often sufficient for challenges.
    
    for i in range(key_len):
        # 1. Get the sub-text (the i-th column)
        sub_text = "".join(ciphertext[j] for j in range(i, len(ciphertext), key_len))
        
        # 2. Calculate observed frequencies for this column
        obs_freqs = {}
        for char in string.ascii_uppercase:
            obs_freqs[char] = sub_text.count(char)
        
        # 3. Find the most frequent letter in the sub-text
        most_freq_char = max(obs_freqs, key=obs_freqs.get)
        
        # 4. Calculate the shift: The shift needed to move most_freq_char back to 'E'
        # Formula: shift = (ord(most_freq_char) - ord('E')) % 26
        shift = (ord(most_freq_char) - ord('E')) % 26
        
        # 5. Convert the shift (0=A, 1=B, etc.) into the key character
        key_char = chr(ord('A') + shift)
        key += key_char
        
        print(f"Column {i+1}: Most Frequent Letter is '{most_freq_char}'. Key Char: **{key_char}**")

    print(f"\n✅ Guessed Key: **{key}**\n")
    return key

def vigenere_decrypt(ciphertext, key):
    """Decrypts the ciphertext using the Vigenère key."""
    key = key.upper()
    key_len = len(key)
    plaintext = ""
    
    for i, cipher_char in enumerate(ciphertext):
        if cipher_char.isalpha():
            # Get the corresponding key character's shift value (0=A, 1=B, ...)
            key_char = key[i % key_len]
            key_shift = ord(key_char) - ord('A')
            
            # Determine starting ASCII (A or a)
            start = ord('A') if cipher_char.isupper() else ord('a')
            
            # Decryption formula: (C - K) mod 26
            decrypted_char_code = (ord(cipher_char) - start - key_shift) % 26 + start
            plaintext += chr(decrypted_char_code)
        else:
            plaintext += cipher_char
            
    return plaintext

